import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import store from "./redux/store"

store.subscribe(()=>{
  ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    document.getElementById('root')
  );
})

